„Dar pirmajame greičio ruože dėl nesusišnekėjimo su šturmanu gavome 3 minučių baudą, po kurios mes jau negalėjome pretenduoti į nugalėtojų poziciją. Tačiau teko susitaikyti su šia mūsų ekipažo žmogiška klaida ir tęsti lenktynes. 2-ame ir 3-ame greičio ruožuose atitinkamai užėmėme 2-ą ir 1-ą pozicijas, tačiau ketvirtajame greičio ruože dėl prakiurusios padangos teko daugiau nei 10 kilometrų važiuoti trimis ratais. Mūsų atsilikimas nuo lyderių padidėjo daugmaž dar 1 minute“, – nesėkmes pasakojo D. Butvilas. Tačiau likusiuose greičio ruožuose D. Butvilo ir K. Hellerio ekipažas trasas įveikė itin greitai ir nugalėjo net 8-iuose greičio ruožuose, o bendroje „Rajd Slaska“ įskaitoje pakilo net į 4-ąją vietą ir į 2-ąją savo klasėje. „Rajd Slaska“ nugalėjo T. Kasperczykas, antrasis liko M. Marczykas, trečiasis – L. Kotarba. D. Butvilas nuo nugalėtojo atsiliko 3 min. 13 sek. Paskutinysis Lenkijos ralio čempionato etapas D. Butvilo ekipažui buvo itin permainingas, tačiau po šio sezono sportininkas įžvelgia daugiau pliusų. „Rodėme stabilų greitį ir daugelio lenkų nuostabai buvome greičiausi didžioje dalyje greičio ruožų. Viso sezono metu nuolat tobulėjome, mokėmės ir greitėjome. „Auto Partner Rally Team“ komandai tai buvo pirmasis sezonas Lenkijos ralio čempionate ir nors jis nebuvo lengvas, bet kiekviename ralyje įgaudavome vis naujos patirties, kurią panaudosime tolimesniuose startuose“, – pozityvias puses išskiria D. Butvilas. Šį sezoną lietuvis lenktyniavo „ Škoda Fabia  R5“ automobiliu „Auto Partner Rally Team“ komandoje ir bendroje Lenkijos ralio čempionato įskaitoje užėmė 5-ąją vietą bei 4-ąją vietą savo klasėje. 2017 metų Lenkijos čempionais tapo F. Nivette ir šiame ralyje D. Butvilui talkinęs šturmanas K. Helleris. (function(d, s, i, r) {
